import topheadOptionImage from './Group284.png'
import './index.css'

const TopheadOptions = () => {
  return (
    <div className='topcontaineroptions'>
        <div className="imageoption">
        <img className='imageoption' src={topheadOptionImage} alt="topHeadOptions" />
        </div>
        
    </div>
  );
}

export default TopheadOptions;
